import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { NavigationBar, DataFetcher, JournalingPage } from './DataFetcher'; // Use named imports here
import './app.css';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <NavigationBar />
      <Switch>
        <Route path="/" exact component={DataFetcher} />
        <Route path="/journaling" component={JournalingPage} />
        {/* Other routes can be added here as needed */}
      </Switch>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
